	const [movie_list, SetMovieList] = React.useState([]);

  axios.get(`https://imdb-api.com/en/API/MostPopularMovies/k_k573whfn`)
	  .then(res => {
	  console.log(res.data);
		SetMovieList(res.data);
    })
    .catch(err => console.log(err));

  return (
    <div>
	{movie_list}
    </div>
  )
}
